import { FaShoppingCart } from "react-icons/fa";
import { useSelector } from "react-redux";
import { NavLink } from "react-router-dom";

const Navbar = () => {
  const { cart } = useSelector((state) => state);

  return (
    <nav className="bg-blue-600 text-white">
      <div className="max-w-6xl mx-auto px-4 py-2 flex justify-between items-center">
        <NavLink to="/" className="flex items-center text-2xl font-bold hover:text-blue-300">
          <img src="../logo.png" alt="Logo" className="h-12 mr-2" />
          Your Brand
        </NavLink>

        <div className="space-x-6">
          <NavLink
            to="/"
            className="text-lg font-medium hover:text-blue-300"
            activeClassName="text-blue-300"
          >
            Home
          </NavLink>

          <NavLink
            to="/cart"
            className="relative text-lg font-medium hover:text-blue-300"
            activeClassName="text-blue-300"
          >
            <FaShoppingCart className="inline-block text-xl mr-2" />
            Cart
            {cart.length > 0 && (
              <span className="absolute -top-2 -right-2 bg-red-600 text-xs w-5 h-5 flex justify-center items-center rounded-full text-white">
                {cart.length}
              </span>
            )}
          </NavLink>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
